import React from 'react';
import './Cards.css';
import CardItem from './CardItem';
// import img from ""

function Cards() {
  return (
    <div className='cards'>
      <h1>Check out these EPIC Destinations!</h1>
      <div className='cards__container'>
        <div className='cards__wrapper'>
          <ul className='cards__items'>
            <CardItem
              src='data:image/jpeg;base64,  '
              text='Tranquil beach featuring a broad stretch of sand & a lighthouse with views from the top'
              label='panamburu beach'
              path='/services'
            />
            <CardItem
              src='data:image/jpeg;base64,'
              text='Sunset viewing is popular at these remains of an 18th-century watchtower on the water.'
              label='sulthan battery'
              path='/services'
            />
          </ul>
          <ul className='cards__items'>
            <CardItem
              src='data:image/jpeg;base64,'
              text='Large zoo with park-like enclosures housing a variety of animals, plus botanical gardens & boating.'
              label='pilikula zoo'
            //   path='/services'
            />
            <CardItem
              src='data:image/jpeg;base64,'
              text='Kudroli was earlier Known as Kudre-halli where Tippu Sultan, the ruler of Mysore, army used to have Horses stables and grazing land, is one of the oldest and well-known localities of Mangalore City located on the Western Coastal belt of Karnataka, India '
              label='Kudroli temple'
            //   path='/products'
            />
            <CardItem
              src='data:image/jpeg;base64,'
              text='Kukke Subramanya is a Hindu temple located in the village Subramanya, of Kadaba taluk in Dakshina Kannada district, Karnataka, India. In this temple Kartikeya is worshipped as Subramanya, lord of all serpents. Ashlesha Bali and Sarpa dosha parihara are two popular puja rituals offered at Kukke Subramanya Temple.'
              label='Kukke Subrahmanya Temple'
            //   path='/sign-up'
            />
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Cards;